"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[5894],{6042:n=>{n.exports=JSON.parse('{"blogPosts":[{"id":"good-docs","metadata":{"permalink":"/blog/good-docs","source":"@site/blog/2024-03-01.mdx","title":"Quality docs","description":"{/truncate/}","date":"2024-03-01T00:00:00.000Z","formattedDate":"March 1, 2024","tags":[{"label":"post","permalink":"/blog/tags/post"},{"label":"docs","permalink":"/blog/tags/docs"}],"readingTime":1.17,"hasTruncateMarker":true,"authors":[{"name":"Keith","title":"Software Engineer","url":"https://github.com/mkeithX","imageURL":"https://github.com/mkeithX.png","key":"mkeithX"}],"frontMatter":{"slug":"good-docs","title":"Quality docs","authors":"mkeithX","tags":["post","docs"]},"unlisted":false,"nextItem":{"title":"Hello, world!","permalink":"/blog/hello-world"}},"content":"{/*truncate*/}\\n## Guidance\\n\\n\ud83d\udca5 Effective documentation is indispensable in software development for numerous reasons. Primarily, it functions as a comprehensive guide, facilitating developers in comprehending the intricacies of the codebase, thereby easing the tasks of maintenance, troubleshooting, and software updates. Well-structured documentation expedites the onboarding process for new team members, enabling them to swiftly grasp the project\'s architecture and functionality.\\n\\n## Collaboration\\n\\n\ud83d\udca5 Documentation fosters collaboration within development teams by establishing a common reference point. It cultivates a shared understanding of the project, its objectives, and the reasoning behind design choices, reducing misunderstandings and fostering efficient teamwork.\\n\\n## Sustainability\\n\\n\ud83d\udca5 Crucially, documentation is a linchpin for the long-term sustainability of a software project. Serving as a valuable resource for future developers, it facilitates seamless transitions between team members and ensures continued development and support, even in the absence of original team members.\\n\\n## Insights\\n\\n\ud83d\udca5 In the realm of quality assurance, thorough documentation proves invaluable in testing and debugging. It offers insights into anticipated behaviors, potential edge cases, and known issues, streamlining the identification and resolution of bugs and contributing to the overall stability and reliability of the software.\\n\\n## Cornerstone\\n\\n\ud83d\udca5 In summary, documentation stands as a cornerstone in software development, championing clarity, collaboration, knowledge dissemination, and the enduring viability of projects. Its absence could lead to confusion, hindered development, and heightened error risks, underscoring its indispensable role in the software development lifecycle."},{"id":"hello-world","metadata":{"permalink":"/blog/hello-world","source":"@site/blog/2024-03-01/index.mdx","title":"Hello, world!","description":"{/truncate/}","date":"2024-03-01T00:00:00.000Z","formattedDate":"March 1, 2024","tags":[{"label":"release","permalink":"/blog/tags/release"},{"label":"hello","permalink":"/blog/tags/hello"}],"readingTime":1.455,"hasTruncateMarker":true,"authors":[{"name":"Keith","title":"Software Engineer","url":"https://github.com/mkeithX","imageURL":"https://github.com/mkeithX.png","key":"mkeithX"}],"frontMatter":{"slug":"hello-world","title":"Hello, world!","authors":"mkeithX","tags":["release","hello"]},"unlisted":false,"prevItem":{"title":"Quality docs","permalink":"/blog/good-docs"}},"content":"{/*truncate*/}\\nHello, world! This is my first blog post.\\n\\nTest 1\\n\\n```bash\\npy -m pip install -U pip\\n```\\n\\n## Test 2\\n\\n```bash npm2yarn\\nnpm install @docusaurus/remark-plugin-npm2yarn\\n```\\n\\n```bash npm2yarn\\nnpm start\\n```\\n\\n```bash npm2yarn\\nnpm run build\\n```\\n\\n## Test 3\\n\\n```py\\nLIGHT_SPEED = 299792  # km/s\\ndistances_from_earth = [\\n    {\'name\': \'Sun\', \'distance\': 150000000},\\n    {\'name\': \'Mercury\', \'distance\': 91691000},\\n    {\'name\': \'Venus\', \'distance\': 41400000},\\n    {\'name\': \'Moon\', \'distance\': 384402},\\n    {\'name\': \'Mars\', \'distance\': 78340000},\\n    {\'name\': \'Asteroid Belt\', \'distance\': 478700000},\\n    {\'name\': \'Jupiter\', \'distance\': 628730000},\\n    {\'name\': \'Saturn\', \'distance\': 1275000000},\\n    {\'name\': \'Uranus\', \'distance\': 2723950000},\\n    {\'name\': \'Neptune\', \'distance\': 4351400000},\\n    {\'name\': \'Kuiper Belt\', \'distance\': 7330000000},\\n    {\'name\': \'Oort Cloud\', \'distance\': 7479890000000},\\n]\\n\\ndef to_light_minutes(distance):\\n    light_minutes = distance / (LIGHT_SPEED * 60)\\n    return round(light_minutes, 2)\\n\\ndef main():\\n    print(\\"Approximate distance from Earth (in Light Minutes):\\")\\n    print()\\n\\n    for planet in distances_from_earth:\\n        name = planet[\'name\']\\n        distance = planet[\'distance\']\\n        light_minutes = to_light_minutes(distance)\\n        print(f\\"{name}: {light_minutes} light minutes\\")\\n\\nif __name__ == \\"__main__\\":\\n    main()\\n```\\n\\n<details>\\n<summary>Show output</summary>\\n\\n```md\\nApproximate distance from Earth (in Light Minutes):\\n\\nSun: 8.34 light minutes\\nMercury: 5.1 light minutes\\nVenus: 2.3 light minutes\\nMoon: 0.02 light minutes\\nMars: 4.36 light minutes\\nAsteroid Belt: 26.61 light minutes\\nJupiter: 34.95 light minutes\\nSaturn: 70.88 light minutes\\nUranus: 151.44 light minutes\\nNeptune: 241.91 light minutes\\nKuiper Belt: 407.5 light minutes\\nOort Cloud: 415837.76 light minutes\\n```\\n\\n</details>\\n\\n\\n## Test 5\\n\\nLet $f$ be a continuous real-valued function defined on a closed interval $[a, b]$, and let $F$ be the function defined by:\\n\\n$$\\nF(x)= \\\\int_{a}^{x}f(t) dt.\\n$$\\n\\nThen, $F$ is continuous on $[a, b]$, differentiable on the open interval $[a, b]$, and $F\'(x) = f(x)$ for all $x$ in $(a, b)$.\\n\\nIn simpler terms, if $f$ is a continuous function, and $F$ is the accumulation (or antiderivative) of $f$, then the derivative of $F$ is $f$."}]}')}}]);